import React from 'react';
import './login.css';

const LoginPage = () => {
  const handleLogin = (e) => {
    e.preventDefault();
    // ログイン処理をここに実装
  };

  const handleRegister = (e) => {
    e.preventDefault();
    // 新規登録ページへの遷移処理をここに実装
  };

  return (
    <>
      <img
        src="components/pawlovers-side.jpg"
        alt="pawlovers logo"
        id="pawlovers-img"
      />

      <form 
        className="login"
        onSubmit={handleLogin}
      >
        <p>&nbsp;</p>
        <label id="item" htmlFor="email">
          メールアドレス
        </label>
        <input
          type="email"
          id="email"
          name="email"
          placeholder="メールアドレスを入力してください"
          required
        />

        <label id="item" htmlFor="password">
          パスワード
        </label>
        <input
          type="password"
          id="login"
          name="password"
          placeholder="パスワードを入力してください"
          required
        />

        <button type="submit">
          ログイン
        </button>
      </form>

      <form 
        className="login"
        onSubmit={handleRegister}
      >
        <p>・・・・・・・・・・・・・・・・初めての方はこちら・・・・・・・・・・・・・・・・</p>
        <button type="submit">
          新規会員登録
        </button>
        <p>&nbsp;</p>
      </form>
    </>
  );
};

export default LoginPage;
